import { HomeComponent } from './home/home.component';
import { DashboardModule } from './dashboard/dashboard.module';
import { MasterLayoutModule } from './master-layout/master-layout/master-layout.module';
import { ContentAreaComponent } from './content-area/content-area.component';


@NgModule({
  declarations: [
    AppComponent,
    HomeComponent,
    ContentAreaComponent,

  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    DashboardModule,
    MasterLayoutModule
  ],
  providers: [],
